//viewBox="0 0 400 400" ---- style="width: 200;" data-simbol=\'{"symbol": "rombo"}\' ondrop="drop(this, event)" ondragenter="dragenter(this, event)" ondragover="dragover(event)" ondragleave="dragleave(this, event)"
function svgAppend(container, cant=5){
    var svg = svgCharge();
    var n = cant>svg.length?svg.length:cant;
    var rand;

    $(container).html("");
    for(let i=0;i<n;i++){
        rand = Math.floor((Math.random() * svg.length));
        let target = $(svg[rand]);
        target.addClass("svgColors");
        target.attr("id", "filled"+i);
        target.attr("data-name", "fill"+i);
        $(container).append(target);
    }

}